import React, {Component} from 'react';
import { StatusBar, StyleSheet, View, ImageBackground, Alert } from 'react-native';
import { Header, Content, Card, CardItem, Body, Text, Button, Form, Item, Label, Input, Icon } from 'native-base';

export default class Products extends Component{
    componentDidMount = () => {
        fetch('https://api.github.com/repositories',{ method: 'GET'})
          .then(response => {
              return response.json();
          })
          .then(response =>{
            console.log(response);
          })
          .catch((error) => {
            console.error(error,"ERRRRRORRR");
          });         
    }
    render(){
        return(
           <Content padder contentContainerStyle={styles.content}>
              <StatusBar barStyle="light-content" backgroundColor="#ccc" />
                <Card>
                  <CardItem header>
                    <Text>PRODUCTO</Text>
                  </CardItem>
                  <CardItem>
                    <Body>
                        <Text> Hola </Text>
                    </Body>
                  </CardItem>
                  <CardItem footer>
                    <Button primary style={{margin: 10}}><Text> Ingresar </Text></Button>   
                  </CardItem>
                </Card>
            </Content>
        )
    }
}
const styles = StyleSheet.create({
  bgGray: {
      backgroundColor: '#00148A',
  },
  textCenter: {
    textAlign: 'center',
    width: '100%',
    fontWeight: 'bold',
    fontSize: 19
  },
  content: {
      flex: 1,
      justifyContent: 'center',
  },
  bodyCard: {
      borderColor: 'transparent',
      borderStyle: 'dashed',
      borderBottomColor: 'transparent',
      borderTopColor: 'transparent',     
  },
  bgCardItem: {
      backgroundColor: 'rgba(255, 255, 255, 0.6)',
      borderColor: 'transparent',
      borderStyle: 'dashed',
      borderRadius: 0,      
  },
  bgCard: {
    backgroundColor: 'transparent',
    borderRadius: 3,
    height: 320,
    borderColor: 'transparent',
  },
  buttonRight: {
      left: '0%',
  },
  buttonLeft: {
      right: '0%',
      marginRight: 20,
      marginLeft: 20
  },
  container: {
    flex: 1,
    width: '100%',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
